                if (type==0)
                {
                    retur.Add("Presence");
                    retur.Add("Location");
                    retur.Add("Date");
                    retur.Add("Time");
                }
                else{
                    retur.Add("PresId");
                    retur.Add("PresLocal");
                    retur.Add("PresDateEvent");
                    retur.Add("PresTimeEvent");
                }
                break;
            case "Review":
                if (type==0)
                {
                    retur.Add("Review");
                    retur.Add("Fecha");
                    retur.Add("Objetivo");
